CREATE TABLE ssgpd_agree_info (
  cust_id         VARCHAR2(20) NOT NULL,
  phone_spoint    CHAR(1)      DEFAULT '0' NULL,
  phone_spoint_dt DATE         NULL,
  delivery        CHAR(1)      DEFAULT '0' NULL,
  delivery_dt     DATE         NULL,
  channel         CHAR(2)      NOT NULL,
  crtn_dt         DATE         NOT NULL,
  crtn_date       CHAR(8)      NOT NULL,
  chg_dt          DATE         NULL,
  chg_date        CHAR(8)      NULL,
  cust_confirm_yn CHAR(1)      NULL,
  data_sync_yn    CHAR(1)      NULL,
  data_sync_dt    DATE         NULL
);

CREATE TABLE ssgpd_agree_history (
  seq               NUMBER         NOT NULL,
  cust_id           VARCHAR2(20)   NOT NULL,
  prev_phone_spoint CHAR(1)        DEFAULT '0' NULL,
  phone_spoint      CHAR(1)        DEFAULT '0' NULL,
  phone_spoint_dt   DATE           NULL,
  prev_delivery     CHAR(1)        DEFAULT '0' NULL,
  delivery          CHAR(1)        DEFAULT '0' NULL,
  delivery_dt       DATE           NULL,
  channel           CHAR(2)        NOT NULL,
  ip_addr           VARCHAR2(20)   NULL,
  user_agent        VARCHAR2(1024) NULL,
  agree_dt          DATE           NOT NULL,
  agree_date        CHAR(8)        NOT NULL
);

drop table ssghd_if_hist_new;

CREATE TABLE ssghd_if_hist_new (
  seq              NUMBER        NULL,
  msg_len          CHAR(4)       NULL,
  msg_text         CHAR(10)      NULL,
  trade_gb_cd      CHAR(6)       NULL,
  trade_gentd_dt   CHAR(8)       NULL,
  trade_gentd_tm   CHAR(6)       NULL,
  trade_no         CHAR(12)      NULL,
  cust_id          CHAR(9)       NULL,
  evd_agree        CHAR(1)       NULL,
  ubpoint          VARCHAR2(20)  NULL,
  system_cre_dt    CHAR(8)       NULL,
  system_cre_tm    CHAR(6)       NULL,
  reply_cd         CHAR(4)       NULL,
  reply_mesg       VARCHAR2(100) NULL,
  filler           VARCHAR2(500) NULL,
  is_response      CHAR(1)       NULL,
  if_date          CHAR(8)       NULL,
  card_sub_info_yn CHAR(1)       DEFAULT '0' NULL,
  addr_sub_info_yn CHAR(1)       DEFAULT '0' NULL,
  terminal_gb      CHAR(2)       DEFAULT '00' NULL
);

